import {Route, Link, Routes} from "react-router-dom"
import Home from "./home/Home";
import Articles from "./articles/Articles";
import Login, {ProtectedRoute, NotProtectedLink} from "./Login";
import Signup from "./Signup";
import AddArticle from "./admin/addArticles";
import DeleteArticle from "./admin/deleteArticles";
import EditArticle from "./admin/editArticles";

import './App.css'

function App() {
  return (
    <>
    <nav>
      <Link to="/">Home</Link>
      <Link to="/articles">News</Link>
      <Link to="/login">Login</Link>
      <Link to="/signup">Sign Up</Link>
    </nav>

      <Routes>
        <Route exact={true} path="/" element={<Home/>}/>
        <Route exact={true} path="/articles" element={<Articles/>}/>
        <Route exact={true} path="/login" element={<Login/>}/>
        <Route exact={true} path="/signup" element={<Signup/>}/>
        <Route exact={true} path="/addArticle" element={<ProtectedRoute><AddArticle/></ProtectedRoute>}/>
        <Route exact={true} path="/deleteArticle" element={<ProtectedRoute><DeleteArticle/></ProtectedRoute>}/>
        <Route exact={true} path="/editArticle" element={<ProtectedRoute><EditArticle/></ProtectedRoute>}/>
        <Route path="*" element={() => <p>Page Not Found</p>} />
      </Routes>
    </>
);
}

export default App;
